package org.tns.decisionmaking;
import java.util.Scanner;
public class Switch {

	public static void main(String[] args) {
		Scanner s=new Scanner(System.in);
		int x=s.nextInt();
		switch(x) {
		case 1:
			System.out.print("Kesaria");
			break;
		case 2:
			System.out.print("Senorita");
			break;
		case 3:
			System.out.print("jumbarabr");
			break;
		case 4:
			System.out.print("Rockbye");
			break;
		case 5:
			System.out.print("Twist");
			break;
		case 6:
			System.out.print("sheella li javani");
			break;	
		default:
			System.out.print("no song");
			break;
		}
		// TODO Auto-generated method stub

	}

}
